import React from 'react';
import './TopBar.css'; // Asegúrate de crear este archivo y aplicarlo

const TopBar = ({ usuario }) => {
  return (
    <div className="top-bar d-flex justify-content-between align-items-center px-4 py-3 border-bottom bg-white">
      <h4 className="mb-0" style={{ fontWeight: 600, color: '#253144' }}>
        Panel de Historias Clínicas
      </h4>
      <span className="text-muted">Usuario: {usuario}</span>
    </div>
  );
};

export default TopBar;
